LL, 1532342461, 1532342461),&#x000A;(2086, &#x27;127.0.0.1&#x27;, 394, 43, 0, &#x27;学习知识要善于思考，思考，再思考&#x27;, 0, &#x27;127.0.0.1&#x27;, &#x27;1gg5se310kk4ho53sl9vvi4or4&#x27;, NULL, NULL, 1532342563, 1532342563),&#x000A;(2087, &#x27;127.0.0.1&#x27;, 394, 43, 0, &#x27;在寻求真理的长河中，唯有学习，不断地学习，勤奋地学习，有创造性地学习，才能越重山跨峻岭。&#x27;, 0, &#x27;127.0.0.1&#x27;, &#x27;1gg5se310kk4ho53sl9vvi4or4&#x27;, NULL, NULL, 1532342578, 1532342578),&#x000A;(2088, &#x27;127.0.0.1&#x27;, 394, 43, 0, &#x27;我们全都要从前辈和同辈学习到一些东西。就连最大的天才，如果想单凭他所特有的内在自我去对付一切，他也决不会有多大成就。&#x27;, 0, &#x27;127.0.0.1&#x27;, &#x27;1gg5se310kk4ho53sl9vvi4or4&#x27;, NULL, NULL, 1532342589, 1532342589),&#x000A;(2089, &#x27;127.0.0.1&#x27;, 394, 43, 0, &#x27;现在，我怕的并不是那艰苦严峻的生活，而是不能再学习和认识我迫切想了解的世界。对我来说，不学习，毋宁死。&#x27;, 0, &#x27;127.0.0.1&#x27;, &#x27;1gg5se310kk4ho53sl9vvi4or4&#x27;, NULL, NULL, 1532342602, 1532342602),&#x000A;(2090, &#x27;127.0.0.1&#x27;, 394, 43, 0, &#x27;人的天才只是火花，要想使它成熊熊火焰，哪就只有学习！学习。&#x27;, 0, &#x27;127.0.0.1&#x27;, &#x27;1gg5se310kk4ho53sl9vvi4or4&#x27;, NULL, NULL, 1532342616, 1532342616),&#x000A;(2091, &#x27;127.0.0.1&#x27;, 394, 43, 0, &#x27;只要愿意学习，就一定能够学会&#x27;, 0, &#x27;127.0.0.1&#x27;, &#x27;1gg5se310kk4ho53sl9vvi4or4&#x27;, NULL, NULL, 1532342625, 1532342625),&#x000A;(2092, &#x27;127.0.0.1&#x27;, 394, 43, 0, &#x27;天才不能使人不必工作，不能代替劳动。要发展天才，必须长时间地学习和高度紧张地工作。人越有天才，他面临的任务也就越复杂，越重要。&#x27;, 0, &#x27;127.0.0.1&#x27;, &#x27;1gg5se310kk4ho53sl9vvi4or4&#x27;, NULL, NULL, 1532342632, 1532342632),&#x000A;(2093, &#x27;127.0.0.1&#x27;, 394, 43, 0, &#x27;谁在装束和发型上用尽心思，谁就没有精力用于学习；谁只注意修饰外表的美丽，谁就无法得到内在的美丽。&#x27;, 0, &#x27;127.0.0.1&#x27;, &#x27;1gg5se310kk4ho53sl9vvi4or4&#x27;, NULL, NULL, 1532342652, 1532342652),&#x000A;(2185, &#x27;30&#x27;, 393, 46, 0, &#x27;第一个&#x27;, 0, &#x27;30&#x27;, &#x27;eejn4jjqad2u0pjdve2dat8tp1&#x27;, NULL, NULL, 1534665844, 1534665844),&#x000A;(2186, &#x27;30&#x27;, 393, 46, 0, &#x27;第二个&#x27;, 2185, &#x27;30&#x27;, &#x27;eejn4jjqad2u0pjdve2dat8tp1&#x27;, NULL, NULL, 1534665992, 1534665992),&#x000A;