an class="p">,</span> <span class="s1">'127.0.0.1'</span><span class="p">,</span> <span class="s1">'1gg5se310kk4ho53sl9vvi4or4'</span><span class="p">,</span> <span class="k">NULL</span><span class="p">,</span> <span class="k">NULL</span><span class="p">,</span> <span class="mi">1532342563</span><span class="p">,</span> <span class="mi">1532342563</span><span class="p">),</span>&#x000A;</div><div class='line' id='LC225'><span class="p">(</span><span class="mi">2087</span><span class="p">,</span> <span class="s1">'127.0.0.1'</span><span class="p">,</span> <span class="mi">394</span><span class="p">,</span> <span class="mi">43</span><span class="p">,</span> <span class="mi">0</span><span class="p">,</span> <span class="s1">'在寻求真理的长河中，唯有学习，不断地学习，勤奋地学习，有创造性地学习，才能越重山跨峻岭。'</span><span class="p">,</span> <span class="mi">0</span><span class="p">,</span> <span class="s1">'127.0.0.1'</span><span class="p">,</span> <span class="s1">'1gg5se310kk4ho53sl9vvi4or4'</span><span class="p">,</span> <span class="k">NULL</span><span class="p">,</span> <span class="k">NULL</span><span class="p">,</span> <span class="mi">1532342578</span><span class="p">,</span> <span class="mi">1532342578</span><span class="p">),</span>&#x000A;</div><div class='line' id='LC226'><span class="p">(</span><span class="mi">2088</span><span class="p">,</span> <span class="s1">'127.0.0.1'</span><span class="p">,</span> <span class="mi">394</span><span class="p">,</span> <span class="mi">43</span><span class="p">,</span> <span class="mi">0</span><span class="p">,</span> <span class="s1">'我们全都要从前辈和同辈学习到一些东西。就连最大的天才，如果想单凭他所特有的内在自我去对付一切，他也决不会有多大成就。'</span><span class="p">,</span> <span class="mi">0</span><span class="p">,</span> <span class="s1">'127.0.0.1'</span><span class="p">,</span> <span class="s1">'1gg5se310kk4ho53sl9vvi4or4'</span><span class="p">,</span> <span class="k">NULL</span><span class="p">,</span> <span class="k">NULL</span><span class="p">,</span> <span class="mi">1532342589</span><span class="p">,</span> <span class="mi">1532342589</span><span class="p">),</span>&#x000A;</div><div class='line' id='LC227'><span class="p">(</span><span class="mi">2089</span><span class="p">,</span> <span class="s1">'127.0.0.1'</span><span class="p">,</span> <span class="mi">394</span><span class="p">,</span> <span class="mi">43</span><span class="p">,</span> <span class="mi">0</span><span class="p">,</span> <span class="s1">'现在，我怕的并不是那艰苦严峻的生活，而是不能再学习和认识我迫切想了解的世界。对我来说，不学习，毋宁死。'</span><span class="p">,</span> <span class="mi">0</span><span class="p">,</span> <span class="s1">'127.0.0.1'</span><span class="p">,</span> <span class="s1">'1gg5se310kk4ho53sl9vvi4or4'</span><span class="p">,</span> <span class="k">NULL</span><span class="p">,</span> <span class="k">NULL</span><span class="p">,</span> <span class="mi">1532342602</span><span class="p">,</span> <span class="mi">1532342602</span><span class="p">),</span>&#x000A;</div><div class='line' id='LC228'><span class="p">(</span><span class="mi">2090</span><span class="p">,</span> <span class="s1">'127.0.0.1'</span><span class="p">,</span> <span class="mi">394</span><span class="p">,</span> <span class="mi">43</span><span class="p">,</span> <span class="mi">0</span><span class="p">,</span> <span class="s1">'人的天才只是火花，要想使它成熊熊火焰，哪就只有学习！学习。'</span><span class="p">,</span> <span class="mi">0</span><span class="p">,</span> <span class="s1">'127.0.0.1'</span><span class="p">,</span> <span class="s1">'1gg5se310kk4ho53sl9vvi4or4'</span><span class="p">,</span> <span class="k">NULL</span><span class="p">,</span> <span class="k">NULL</span><span class="p">,</span> <span class="mi">1532342616</span><span class="p">,</span> <span class="mi">1532342616</span><span class="p">),</span>&#x000A;</div><div class='line' id='LC229'><span class="p">(</span><span class="mi">2091</span><span class="p">,</span> <span class="s1">'127.0.0.1'</span><span class="p">,</span> <span class="mi">394</span><span class="p">,</span> <span class="mi">43</span><span c